export const removeFromCart = (cartItemId) => ({
  type: REMOVE_FROM_CART,
  payload: cartItemId,
});

export const increaseQuantity = (cartItemId) => ({
  type: INCREASE_QUANTITY,
  payload: cartItemId,
});

export const decreaseQuantity = (cartItemId) => ({
  type: DECREASE_QUANTITY,
  payload: cartItemId,
});
